export const CreatePost = () => {
    return (
       <form>
        <input type='title' placeholder="Title" />
        <input type='summary' placeholder="Title" />
        <input type='file' placeholder="Title" />
        <ReactQuill />
       </form>
    )
}

export default CreatePost;
